FROM score_soft_max) AS soft_max_comp ON soft_max_comp."KEY_softmax" = "arg_max_t_Score"."KEY_Score")
 SELECT arg_max_cte."KEY" AS "KEY", CAST(NULL AS DOUBLE) AS "Score_0", CAST(NULL AS DOUBLE) AS "Score_1", arg_max_cte."SoftProba_0" AS "Proba_0", arg_max_cte."SoftProba_1" AS "Proba_1", CASE WHEN (arg_max_cte."SoftProba_0" IS NULL) THEN arg_max_cte."SoftProba_0" ELSE CASE WHEN (arg_max_cte."SoftProba_0" > 0.0) THEN log(arg_max_cte."SoftProba_0") ELSE -1.79769313486231e+308 END END AS "LogProba_0", CASE WHEN (arg_max_cte."SoftProba_1" IS NULL) THEN arg_max_cte."SoftProba_1" ELSE CASE WHEN (arg_max_cte."SoftProba_1" > 0.0) THEN log(arg_max_cte."SoftProba_1") ELSE -1.79769313486231e+308 END END AS "LogProba_1", arg_max_cte."arg_max_Score" AS "Decision", CASE WHEN (arg_max_cte."SoftProba_0" <= arg_max_cte."SoftProba_1") THEN arg_max_cte."SoftProba_1" ELSE arg_max_cte."SoftProba_0" END AS "DecisionProba" 
FROM arg_max_cte